export default function CreatedApplicationList({ sentApplications }) {
  return (
    <div className="">
      <p>My Applications List</p>
      <div></div>
    </div>
  );
}

function SentApplicationList({
  profName,
  department,
  project,
  status,
  decision,
}) {
  return (
    <div>
      {profName}
      <br />
      {department}
    </div>
  );
}
